import React from "react";
import Input from "../Input/Input";

const Header = () => {
  return (
    <div className="header">
      <div className="header_item">
        <div>
          <p>LOGO</p>
        </div>
        <div>
            <Input type="email" placeholder="Email" className="w-[320px] h-[48px] rounded "/>

        </div>
      </div>
    </div>
  );
};

export default Header;
